        super();
        this.state={

        }
    }
    render(){
        return(
            <div>

                <form>
                    <label>full name:</label>
                    <input type="text"/ >
                    <br></br>
                    <label>email:</label>
                    <input type="email"/>
                    <br></br>
                    <label>password:</label>
                    <input type="password"/>
                    <br></br>
                    <label>confirm password:</label>
                    <input type="password"/>
                    <br></br>
                    <input type="submit" />
                </form>


            </div>
        )
    }
}
export default Navi;
